export default function Timeline() {
    return(
        <>
        <Grid justify="center">

        <Grid.Col span={12}>
            <Header />
        </Grid.Col>
        <Grid.Col span={12} style={{maxWidth: 450}}>
            <PlaylistFeed />
        </Grid.Col>
        <br />
        <Grid.Col span={12} style={{maxWidth: 450}}>
            <AddPlaylist />
        </Grid.Col>

        </Grid>

        </>

    )
}
